import NavBarRHome from "../navbars/NavBarHome";
import '../css/Home.css';


function Home() {



    return (

        <div className="container">
            <NavBarRHome />

            <h1 className="h1">
                Welcome to Car Rental System</h1>

            <div className="container float-right">
                <h4>Hassel free ,affordable commute.Rent electric scooters & bikes</h4>

            </div>
        </div>

    )

}
export default Home;
